const About = () => {
  return (
    <div className="about">
      <h1>About me</h1>
      <p>
        Helvetica put a bird on it church-key Blue Bottle banjo bespoke brunch
        Etsy authentic Marfa quinoa typewriter plaid direct trade small batch
        wayfarers...
      </p>
    </div>
  );
};

export default About;
